import './App.css';
import { Route, Routes, useNavigate, useParams } from 'react-router-dom';
import Main from './pages/Main.jsx';
import { useDispatch, useSelector } from 'react-redux';
import { LOGGED_ROUTES, UNLOGGED_ROUTES } from './constants/routes';
import { ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import { useTranslation } from 'react-i18next';
import { PublicApi } from './api/api';
import { useEffect, useState } from 'react';
import axios from 'axios';
import Header from './components/Header'
import Logo from './components/AuthLogo/Logo';
import { Link } from 'react-router-dom';
import { setNewPassword, validateToken } from './api/auth';
import { ResetPassConfirm } from './components/ResetPassConfirm/ResetPassConfirm';
import { setLanguage } from './redux/slices/generalSlice';

const NotFound = () => (<>Page not found</>);

const ResetPassword = () => {
  const dispatch = useDispatch();
  const navigate = useNavigate();
  const [tokenChecked, setTokenChecked] = useState('Loading');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const {token} = useParams();
  const {t} = useTranslation()
  const { language } = useSelector(state => state.general);

  const handleLanguageChange = e => {
      dispatch(setLanguage(e.target.value));
  }

  useEffect(() => {
    dispatch(validateToken({token}))
    .unwrap()
    .then((res) => {
      if (res.status === 'OK') {
        setTokenChecked(true);
      }
      else {
        setTokenChecked(false);
      }
    })
    .catch(() => setTokenChecked(false));
  }, []);

  function onResetPassword() {
    if (password === confirmPassword) {
      dispatch(setNewPassword({password, token}))
      .unwrap()
      .then((res) => {
        if (res.status === 'OK') {
          navigate('/login');
        }
      })
    }
  }

  if (tokenChecked === 'Loading') {
    return (<h1>Loading...</h1>);
  }
  if (tokenChecked === false) {
    return (<h1>Page doesn't exist</h1>);
  }

  return(
    <div className="Login">
    <div className='header'>
    <Header/>
    </div>
    <div className='Logo'>
      <Logo/>
      </div>
      <div className='content'>
      <div className="reg">

            <div className='reg_btns'>
                <div className='reg_light'></div>
                <div className='reg_light'></div>
                <div className='reg_light_active'></div>

            </div>
            <h1 className='restore_title'>{t('create_new_pass')}</h1>
             <div>
     <label htmlFor='password'></label>
       <input placeholder={t('new_pass')} className='password_confirm' id="password" type="password" onChange={({target}) => setPassword(target.value)}/> 
       <label htmlFor='confirmPassword'></label>
       <input placeholder={t('check_pass')} className='password_confirm' id="confirmPassword" type="password" onChange={({target}) => setConfirmPassword(target.value)}/>
       <button className='reg_submit' type="button" onClick={onResetPassword}>{t('auth_newPass')}</button>
     </div>
     <div className='block5'>
                    <p>
                        {t("key_recall")}{" "}
                        <Link
                        to={'/login'}
                            style={{
                                textDecoration: "none",
                                color: "#7F3A85",
                                cursor: "pointer",
                            }}
                        >
                            {t("reg_login")}
                        </Link>
                    </p>
                </div>
                <div className='block6'>
                    <p>
                        {t("auth_acc")}{" "}
                        <Link
                            to={"/register"}
                            style={{
                                textDecoration: "none",
                                color: "#7F3A85",
                                cursor: "pointer",
                            }}
                        >
                            {t("reg_submit")}
                        </Link>
                    </p>
                </div>

                <div className='block7'>
                    <select
                        className='select_css'
                        name="language"
                        id="language"
                        value={language}
                        onChange={handleLanguageChange}

                    >
                        <option id="ky" value="ky">
                            кыргызча
                        </option>
                        <option id="ru" value="ru">
                            русский
                        </option>
                    </select>
                </div>
        </div>


      </div>



  </div>
    // <div>
    //   <label htmlFor='password'>New password</label>
    //   <input id="password" type="password" onChange={({target}) => setPassword(target.value)}/> 
    //   <label htmlFor='confirmPassword'>Confirm password</label>
    //   <input id="confirmPassword" type="password" onChange={({target}) => setConfirmPassword(target.value)}/>
    //   <button type="button" onClick={onResetPassword}>Reset password</button>
    // </div>
  );
}

function App() {
  const { isLogged, user } = useSelector(state => state.auth);
  return (
    <div className="App">   
      <Routes>
        <Route path='/' element={<Main/>} />
        {
          isLogged ?
          LOGGED_ROUTES.map((item, index) => <Route key={index} path={item.path} element={item.element} />)
          :
          UNLOGGED_ROUTES.map((item, index) => <Route key={index} path={item.path} element={item.element} />)
        }
        {

        }

        <Route path="/auth/reset-password/:token" element={<ResetPassword />}/>  
         {/* <Route path="/auth/reset-password/:token" element={<ResetPassConfirm />}/>  */}

        <Route path="/*" element={<NotFound />}/>
      </Routes>
      <ToastContainer/>
  </div>
  );
}

export default App;
